import React from 'react';
import ContactForm from './ContactForm';
import Gallery from './Gallery';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* Logo, nazwa warsztatu, dane kontaktowe */}
      </header>
      <section className="App-services">
        {/* Opis usług */}
      </section>
      <ContactForm />
      <Gallery />
      <footer className="App-footer">
        {/* Informacje prawne, media społecznościowe, mapa */}
      </footer>
    </div>
  );
}

export default App;
